import React from "react";
import CarouselComponent from "./(utils)/Carousel";

const TrendingNow = () => {
  return (
    <div className="flex flex-col gap-5 pl-10 pt-10">
      <div className="text-xl font-bold flex flex-row p-1 gap-10">
        <div>Trending</div>
        <div className="flex gap-23">
          <span>Today</span>
          <span>All Week</span>
        </div>
      </div>
      <div>
        <CarouselComponent />
      </div>
    </div>
  );
};

export default TrendingNow;
